import React from 'react'
import { Tabs, Avatar, Input  } from 'antd'
import { UserOutlined } from '@ant-design/icons';
import './Miempresa.scss'

const { TabPane } = Tabs;
function callback(key) {
    console.log(key);
  }

export default function Miempresa() {
    return (
        <Tabs className="tab" onChange={callback} type="card">
            <TabPane className="tabPane" tab="Información" key="1">
                <div className="info">
                    <h2 style={{textAlign: "left"}}>Información de Mi empresa</h2>
                    <br/>
                    <p><Avatar className="avatar" size={64} icon={<UserOutlined />} /></p>
                    <p><Input placeholder="Basic usage" /></p>
                </div>
                
            </TabPane>
            <TabPane  className="tabPane" tab="Cultura" key="2">
            Content of Tab Pane 2
            </TabPane>
        </Tabs>
    )
}
